import React from 'react';
import styled from 'styled-components';
import { Container, Row, Col } from 'reactstrap';
import { Link } from 'react-router-dom';
import { Jumbotron, Image, Button } from 'react-bootstrap';
import './Home.css';
/*
export const Home = (props) => (
  <header className="masthead">
  <div className="container">
    <div className="intro-text">
      <div className="intro-lead-in">We are Georgia Tech 2020 IDEAS REU.</div>
      {/*<div className="intro-heading text-uppercase">It's Nice To Meet You</div>}
      {/*<a className="btn btn-primary btn-xl text-uppercase js-scroll-trigger" href="#services">Tell Me More</a>}
    </div>
  </div>
  <Container> 
    <Row xs="2">
      <Col xs="6">Section 1</Col>
      <Col>Section 2</Col>
    </Row>
  </Container>
</header>
)
*/

const jumbotronstyle = {
  backgroundColor: 'black',
  width: 'auto',
  height: '300px'

}

export default class Home extends React.Component {
  render() {
    return (

      <Container fluid>

        <Jumbotron fluid style={jumbotronstyle}>
          <h2>We are Georgia Tech 2020 IDEAS REU.</h2>
          <p>*Tagline goes here*</p>
          <Link to="/about">
            <Button bsstyle="primary">Learn More</Button>
          </Link>
        </Jumbotron>
        <Row className="show-grid text-center">
          <Col xs={12} sm={8} className="person-wrapper">
            <Image src="assets/person-1.jpg" circle='true' className="profile-pic"/>
            <h3>Frank</h3>
            <p>That's a crooked tree. We'll send him to Washington. These little son of a guns hide in your brush and you just have to push them out.</p>
          </Col>
          <Col xs={12} sm={4} className="person-wrapper">
            <Image src="assets/person-2.jpg" circle className="profile-pic"/>
            <h3>Vanessa</h3>
            <p>That's a crooked tree. We'll send him to Washington. These little son of a guns hide in your brush and you just have to push them out.</p>
          </Col>

        </Row>
      </Container>
    )
  }
}
